import React from 'react'
import D3Node from '../d3Node/D3Node'

const Input = (props) => {

    const inputHandler = (event) => {
        let name = document.getElementById('name')
        console.log('test')
        return (
            <D3Node 
            name={event.value}
        />
        )
    }

    return(
        <div>
             <label class='nameL' htmlFor='name'>Name</label>
            <input
                id='name'
                type='text'
                label="Name"
            />
            <button class='button' type='submit' id='apply' onClick={inputHandler}>Submit</button>
        </div>
    )
}

export default Input
